import Item from './item'

const Items = (props) => {
    return( 
    <ol>
        {props.todos.map((todo, i) => ( 
            //<div key={i}>{todo}</div>
            <Item item={todo} key={i} />
        ))}
    </ol>
    )
}

export default Items
